{"query":"query fetchErrorsInboxFacetedData($accountId:Int!) {
						actor {
						  account(id: $accountId) {
							nrql(query: "SELECT latest(timestamp) AS 'lastOccurrence', latest(id) AS 'occurrenceId', latest(appName) AS 'appName', latest(error.class) AS 'errorClass', latest(message) AS 'message', latest(entityGuid) AS 'entityGuid', count(id) AS 'length' FROM ErrorTrace WHERE fingerprint IS NOT NULL and entityGuid='MXxBUE18QVBQTElDQVRJT058NDU4ODUwMjY' FACET fingerprint AS 'fingerPrintId' SINCE 3 days ago LIMIT MAX", timeout: 60) { nrql results }
						  }
						}
					  }
					  ","variables":{"accountId":1}}

